t?&amp;lt;/span&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/h2&amp;gt;&amp;lt;p&amp;gt;A chatbot is a computer program that simulates human conversation with an end user. Not all chatbots are equipped with artificial intelligence (AI), but modern chatbots increasingly use conversational AI techniques such as natural language processing (NLP) to understand user questions and automate responses to them.&amp;lt;/p&amp;gt;&amp;lt;h2&amp;gt;What are current limitations of Chatbots?&amp;lt;/h2&amp;gt;&amp;lt;div&amp;gt;Currently, Chatbots suffer from a phenomenon called &amp;quot;Hallucination&amp;quot;, which describes an unwanted behavior of these AI systems that produces non-sensible, not-provable or not plausible statements. Currently, researchers are about to investigate where this phenomenon comes from and how to mitigate it. A potential solution is to apply Explainable Artificial Intelligence (XAI), a technique that creates post-hoc explanations for the output of an AI system. These explanations can be sub-symbolic, like texutal reasoning, or symbolic, like the display of an explanation graph.&amp;lt;span style=&amp;quot;background-color: initial;&amp;quot;&amp;gt;&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\&quot; style=\&quot;text;html=1;strokeColor=none;fillColor=none;spacing=5;spacingTop=-20;whiteSpace=wrap;overflow=hidden;rounded=0;fontFamily=BMWGroupTN;\&quot; parent=\&quot;9H5rPylZbU-pUf7GKbjA-1\&quot; vertex=\&quot;1\&quot;&gt;\n          &lt;mxGeometry x=\&quot;180\&quot; y=\&quot;260\&quot; width=\&quot;755\&quot; height=\&quot;230\&quot; as=\&quot;geometry\&quot; /&gt;\n        &lt;/mxCell&gt;\n        &lt;mxCell id=\&quot;9H5rPylZbU-pUf7GKbjA-10\&quot; value=\&quot;\&quot; style=\&quot;shape=image;aspect=fixed;image=data:image/png,iVBORw0KGgoAAAANSUhEUgAAAkQAAADCCAYAAAColt22AAAABHNCSVQICAgIfAhkiAAAAAlwSFlzAAAbrwAAG68BXhqRHAAAABl0RVh0U29mdHdhcmUAd3d3Lmlua3NjYXBlLm9yZ5vuPBoAACAASURBVHic7J13mBXl1cB/Z+7dBRRQQLG3WLHEHhXryt7ZZVVQiYi998Qo0aDIncvMYsNYop/GHnvBT
